INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (5014, 0, 10, 0.5, "うん。私とヒヨリで作ったんだ。\nユイにはいつだって助けられてるから\nせめてものお返しだよ。\n……誕生日おめでとう。ユイ。", 1, 100311, 11, 0, 5014060, 1);
