INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (13114, 0, 10, 0.5, "ふっふっふ、とーぜんですよ！\nさあさあカヤぴぃ！\n存分にあたしに感謝するがいいです！", 1, 106611, 11, 0, 13114062, 1);
