INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (16614, 0, 10, 0.5, "………………そう、ですか。\nそれならありがたく\nいただくことにしましょう。", 1, 102711, 11, 0, 16614078, 1);
