INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (18814, 0, 10, 0.5, "どう見たって誕生日ケーキだろう？\n心配しなくても、ナナカのお祝いだ。\n誕生日、おめでとう。", 1, 105611, 11, 0, 18814076, 1);
