INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (18814, 0, 10, 0.5, "ケーキとは別に、プレゼントも\nいくつか用意してあるのよ。\n私たちじゃどんなのがいいか\nよく分からなかったから……", 1, 105111, 11, 0, 18814081, 1);
