INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (27814, 0, 10, 0.5, "うんうん、せっかくだから、\nみんなでおいしく頂こうじゃないか♪\nそれにかわいらしいボクが祝うんだから、\n最高の誕生日になるよ♪", 1, 100811, 11, 0, 27814088, 1);
