INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (28414, 0, 10, 0.5, "わわっ、大きなケーキッス！\n……え、もしかして自分のッスかねっ？\n誕生日覚えてくれてたッスか？", 1, 100511, 11, 0, 28414063, 1);
