INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (28414, 0, 10, 0.5, "もちろんだよ。\n誕生日おめでとう、マツリちゃん。\nこの間の予防注射もきちんと受けてたし\n大人にまた一歩近づいたね♪", 1, 103711, 11, 0, 28414068, 1);
