INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (32114, 0, 10, 0.5, "今さら気にするくらいなら、\n普段からしっかりやればいいのに。\n……なんてお小言はさておき、\nお誕生日おめでとう、リンちゃん♪", 1, 105211, 11, 0, 32114070, 1);
