INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (32314, 0, 10, 0.5, "ミサキっち、ホントおめでと～！\nとりま、飲み物はコーヒーでよさげ？\nお店で大人っぽい味でよろ～って\n頼んだら、おに苦くされたけど！", 1, 101611, 11, 0, 32314063, 1);
