INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (34314, 0, 10, 0.5, "ちょっと、欲張り過ぎでしょう！？\n一年に何回もこんなことしたら、\nランドソルからプリンが\n消えちゃうわよ！", 1, 102211, 11, 0, 34314086, 1);
