INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (35814, 0, 10, 0.5, "なるほど、よく分かった。\nさては真面目に祝う気がないな？\n二人ともそこに並べ、ケーキの前に\nその無礼な舌先から切り分けてやろう☆", 1, 107111, 11, 0, 35814080, 1);
