INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (38214, 0, 10, 0.5, "マヒルさん、どうしました……？\nもしかして、誕生日ケーキに\n変なところでも……？", 1, 103811, 11, 0, 38214070, 1);
INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (38214, "", "", "", "", "", 0, 91, "", 38214071, "");
