INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (38214, 0, 10, 0.5, "そうそう。\n難しい顔するより、\nみんなで楽しくおいしくケーキを\n食べましょう♪", 1, 105211, 11, 0, 38214085, 1);
